begin
if not exists(select 1 from instance where instanceid=@NumeratorID)
insert into instance(instanceid,name,objtype) values(@NumeratorID,''Numerator'',''STDNumerator'')

-- New Zone
if not exists(select 1 from num_zones where zonemask=@the_zone and instanceid=@NumeratorID)
  begin
    set @num =1
    set @ID1 = newid()
    set @ID2 = newid()
    insert into num_zones(num_zonesid,instanceid, zonemask) values(@id1,@NumeratorID, @the_zone)
    insert into num_Values(num_valuesid,parentstructrowid, the_Value,OwnerPartName,OwnerRowID) values(@id2,@ID1, @num,@OwnerPartName,@OwnerRowID)
    return
  end
else
  begin
  select @ID1=num_zonesid from num_zones where zonemask=@the_zone and instanceid=@NumeratorID

  -- frist item in Zone
  if not exists(select 1 from num_values where parentStructRowID=@ID1 )
    begin
      set @num =1
      set @ID2 = newid()
      insert into num_Values(num_valuesid,parentstructrowid, the_Value,OwnerPartName,OwnerRowID) values(@id2,@ID1, @num,@OwnerPartName,@OwnerRowID)
      return
    end
  else

    -- Items exists in zone
    begin

      set @n=null

      declare cc cursor for  select the_value from num_values where parentStructRowID=@ID1 and the_value >1   order by the_value      
      open cc
      fetch next from cc into @n
      while @@fetch_status >=0	
      begin
       
       -- try to get previous whole
       if not exists( select 1 from num_values where parentStructRowID=@ID1 and the_value=@n-1)
       begin
	set @n=@n-1
	goto found
       end

       -- try to get next whole
       if not exists( select 1 from num_values where parentStructRowID=@ID1 and the_value=@n+1)
       begin
	set @n=@n+1
	goto found
       end
       fetch next from cc into @n
      end	

      --no wholes found	
      set @n=null
found:
      close cc
      deallocate cc

      -- gem max+1 if no wholes	
      if @n is null
        select @n = max(the_value)+1 from num_values where parentStructRowID=@ID1
      end	

      --register value	
      set @ID2 = newid()
      insert into num_Values(num_valuesid,parentstructrowid, the_Value,OwnerPartName,OwnerRowID) values(@id2,@ID1, @n,@OwnerPartName,@OwnerRowID)
      set @num = @n
   
  end
end',G2B('{0C652C58-A952-4E8F-8CB0-D266431CD24B}'));

